import React from "react";
import PropTypes from "prop-types";

function Item({ todo, index }) {
  return (
    <li>
      <span>
        <input type></input>
      </span>
      <strong>{index + 1}. </strong>
      {todo.title}
    </li>
  );
}

Item.propTypes = {
  todo: PropTypes.object.isRequired,
  index: PropTypes.number,
};

export default Item;
